Parses the given `string` into a `bigint` using JavaScript semantics. Return the
number as a `bigint` if successfully parsed. Uncaught syntax exception otherwise.

## Examples

```rescript
/* returns 123n */
Js.BigInt.fromStringExn("123")

/* returns 0n */
Js.BigInt.fromStringExn("")

/* returns 17n */
Js.BigInt.fromStringExn("0x11")

/* returns 3n */
Js.BigInt.fromStringExn("0b11")

/* returns 9n */
Js.BigInt.fromStringExn("0o11")

/* catch exception */
try {
  Js.BigInt.fromStringExn("a")
} catch {
| _ => ...
}
```

Tests if the given value is finite. Return `true` if the given value is a finite
number, `false` otherwise. See [`isFinite`](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Number/isFinite) on MDN.

## Examples

```rescript
/* returns [false] */
Js.Float.isFinite(infinity)

/* returns [false] */
Js.Float.isFinite(neg_infinity)

/* returns [false] */
Js.Float.isFinite(Js.Float._NaN)

/* returns [true] */
Js.Float.isFinite(1234.)
```

Parses the given `string` into a `float` using JavaScript semantics. Return the
number as a `float` if successfully parsed, `_NaN` otherwise.

## Examples

```rescript
/* returns 123 */
Js.Float.fromString("123")

/* returns 12.3 */
Js.Float.fromString("12.3")

/* returns 0 */
Js.Float.fromString("")

/* returns 17 */
Js.Float.fromString("0x11")

/* returns 3 */
Js.Float.fromString("0b11")

/* returns 9 */
Js.Float.fromString("0o11")

/* returns [_NaN] */
Js.Float.fromString("hello")

/* returns [_NaN] */
Js.Float.fromString("100a")
```

`assign(target, source)` copies properties from source to target.
Properties in `target` will be overwritten by properties in `source` if they have the same key.
Returns `target`.

**See** [MDN](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Object/assign)

## Examples

```rescript
/* Copy an object */

let obj = {"a": 1}

let copy = Js.Obj.assign(Js.Obj.empty(), obj)

/* prints "{ a: 1 }" */
Js.log(copy)

/* Merge objects with same properties */

let target = {"a": 1, "b": 1}
let source = {"b": 2}

let obj = Js.Obj.assign(target, source)

/* prints "{ a: 1, b: 2 }" */
Js.log(obj)

/* prints "{ a: 1, b: 2 }", target is modified */
Js.log(target)
```

`parseExn(s)` parses the `string` `s` into a JSON data structure.
Returns a JSON data structure.
Raises `SyntaxError` if the given string is not a valid JSON. Note: `SyntaxError` is a JavaScript exception.

See [`parse`](https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/JSON/parse) on MDN.

## Examples

```rescript
/* parse a simple JSON string */

let json = try Js.Json.parseExn(` "hello" `) catch {
| _ => failwith("Error parsing JSON string")
}

switch Js.Json.classify(json) {
| Js.Json.JSONString(value) => Js.log(value)
| _ => failwith("Expected a string")
}
```

```rescript
/* parse a complex JSON string */

let getIds = s => {
  let json = try Js.Json.parseExn(s) catch {
  | _ => failwith("Error parsing JSON string")
  }

  switch Js.Json.classify(json) {
  | Js.Json.JSONObject(value) =>
    /* In this branch, compiler infer value : Js.Json.t Js.Dict.t */
    switch Js.Dict.get(value, "ids") {
    | Some(ids) =>
      switch Js.Json.classify(ids) {
      | Js.Json.JSONArray(ids) => /* In this branch compiler infer ids : Js.Json.t array */
        ids
      | _ => failwith("Expected an array")
      }
    | None => failwith("Expected an `ids` property")
    }
  | _ => failwith("Expected an object")
  }
}

/* prints `1, 2, 3` */
Js.log(getIds(` { "ids" : [1, 2, 3 ] } `))
```

Clear an interval started by `Js.Global.setInterval`

## Examples

```rescript
/* API for a somewhat aggressive snoozing alarm clock */

let punchSleepyGuy = () => Js.log("Punch")

let interval = ref(Js.Nullable.null)

let remind = () => {
  Js.log("Wake Up!")
  punchSleepyGuy()
}

let snooze = mins =>
  interval := Js.Nullable.return(Js.Global.setInterval(remind, mins * 60 * 1000))

let cancel = () =>
  Js.Nullable.iter(interval.contents, (. intervalId) => Js.Global.clearInterval(intervalId))
```

Clear a timeout started by `Js.Global.setTimeout`.

## Examples

```rescript
/* A simple model of a code monkey's brain */

let closeHackerNewsTab = () => Js.log("close")

let timer = ref(Js.Nullable.null)

let work = () => closeHackerNewsTab()

let procrastinate = mins => {
  Js.Nullable.iter(timer.contents, (. timer) => Js.Global.clearTimeout(timer))
  timer := Js.Nullable.return(Js.Global.setTimeout(work, mins * 60 * 1000))
}
```

Repeatedly executes a callback with a specified interval (in milliseconds)
between calls. Returns a `Js.Global.intervalId` that can be passed to
`Js.Global.clearInterval` to cancel the timeout.

## Examples

```rescript
/* Will count up and print the count to the console every second */

let count = ref(0)

let tick = () => {
  count := count.contents + 1
  Js.log(Belt.Int.toString(count.contents))
}

Js.Global.setInterval(tick, 1000)
```

